import { Text, View } from "react-native";
import { screenHeight,screenWidth } from "../../../../../ChatList/Constants/ConstantsForChatlist";
import React from "react";
import ContainerForButtonForSettings from "../../../../../SemiComponents/ContainerForButtonForSettings";
interface ContainerForButtonForSettings {
    children?: React.ReactNode;
}

const AddExeptions: React.FC<ContainerForButtonForSettings> = ({ children }) => {
  return (
    <ContainerForButtonForSettings>
    <View style={{ alignSelf: "center", position: "relative" }}>
      </View>
      <Text
        style={{
          fontSize: 16,
          marginLeft: 5,
          alignSelf: "center",
          color: "#6A38AD",
        }}
      >
        {children}
      </Text>
    </ContainerForButtonForSettings>
  );
};
export default AddExeptions;
